import styled from 'styled-components';

export const Main = styled.div`
  width: 1440px;
  padding-left: 20px;
  padding-right: 20px;
  margin-left: auto;
  margin-right: auto;
`;

export const Title = styled.h2`
  text-transform: uppercase;
  font-size: 32px;
  font-weight: 600;
`;
